import React, { Fragment } from "react";
import styled, { ThemeProvider } from "styled-components";
import { flexCenter, imgUrl, theme } from "../../styles/CommonStyle";

const Certification = () => {
  return (
    <Fragment>
      <ThemeProvider theme={theme}>
        <Certify>
          <Logo src={imgUrl.logo} />
          <WrapHeader>
            <Header>핸드폰 인증</Header>
          </WrapHeader>
          <Main>
            <WrapUser>
              <span>이름</span>
              <UserName />
            </WrapUser>
            <WrapNumber>
              <span>번호</span>
              <PhoneNumber />
            </WrapNumber>
            <CertifyNumber></CertifyNumber>
          </Main>
        </Certify>
      </ThemeProvider>
    </Fragment>
  );
};

export default Certification;

const Logo = styled.img`
  width: 120px;
  height: 110px;
  margin: 130px 0 70px 0;
`;

const Certify = styled.section`
  font-size: 25px;
  ${flexCenter};
  flex-direction: column;
`;

const WrapHeader = styled.div`
  ${flexCenter};
  width: 1200px;

  background-color: #fff;
  border-bottom: 3px solid rgba(0, 0, 0, 0.2);
`;

const Header = styled.h1`
  ${flexCenter};
  width: 600px;
  padding: 20px;
  margin-bottom: 40px;
  color: #fff;
  background-color: ${theme.skyblue};
  border-radius: 5px;
  font-size: 30px;
`;

const Main = styled.div`
  display: flex;
  flex-direction: column;
  margin-top: 100px;
  font-size: 17px;
`;

const WrapUser = styled.div`
  ${flexCenter};
  margin-bottom: 20px;

  span {
    margin-right: 30px;
  }
`;
const WrapNumber = styled.div`
  ${flexCenter};

  span {
    margin-right: 30px;
  }
`;

const UserName = styled.input`
  width: 200px;
  height: 40px;
  border: 1px solid rgba(0, 0, 0, 0.2);
`;

const PhoneNumber = styled.input`
  width: 200px;
  height: 40px;
  border: 1px solid rgba(0, 0, 0, 0.2);
`;

const CertifyNumber = styled.div``;
